2165.css:
.grid-item {
   overflow: hidden;
   border-radius: var(--liza-layout-content-border-top-left-radius);
}
 .wrap {
   display: flex;
   align-items: center;
   color: #000000;
   font-family:'YS Text', Arial, sans-serif;
   font-size: 13px;
   padding: 4px 44px 4px 4px;
}
.domain .ya-unit-favicon+.image-wrapper {
	display: none;
}
 .image-wrapper {
   display: flex;
   flex: none;
   align-items: center;
   justify-content: center;
   background: linear-gradient(0deg, rgba(34, 36, 38, 0.06), rgba(34, 36, 38, 0.06));
   border-radius: 6px;
   overflow: hidden;
}
 .image {
   overflow: hidden;
   height: 28px;
}
 .image-small {
   width: 28px;
   display: none;
}
 .image-big {
   width: 64px;
}
 .body {
   flex: 1 1 auto;
   white-space: nowrap;
   overflow: hidden;
   margin-left: 30px;
   display: flex;
   align-items: center;
}
 .almost-all {
   flex: 1 1 auto;
   overflow: hidden;
   text-overflow: ellipsis;
   display: flex;
   align-items: center;
}
 .title-with-domain {
   max-width: 100%;
   display: flex;
}
.domain-with-category{
	width: 100%;
   max-width: 265px;
   display: flex;
   align-items: center;
}
 .title {
   font-weight: 700;
   flex: 1 1 auto;
   overflow: hidden;
   text-overflow: ellipsis;
}
.title::after {
    content: "";
    display: inline-block;
    width: 10px;
}
 .domain {
   max-width: 100%;
   display: flex;
   white-space: nowrap;
   align-items: center;
   overflow: hidden;
   text-overflow: ellipsis;
}
 .favicon {
   margin-right: 1px;
   flex: none;
   margin-left: 12px;
   border-radius: 4px;
   width: 22px;
   height: 22px;
}
 .domain-text {
   margin-left: 12px;
   flex: 1 1 auto;
   overflow: hidden;
   text-overflow: ellipsis;
   word-break: break-all;
}
 .favicon+.domain-text {
   margin-left: 8px;
}
 .desc {
   margin-left: 12px;
   overflow: hidden;
   text-overflow: ellipsis;
}
 .ya-unit-sitelinks {
   display: flex;
   margin-left: 12px;
   overflow: hidden;
   text-overflow: ellipsis;
   opacity: 0.5;
}
 .ya-unit-sitelink:hover {
   text-decoration: underline;
}
 .ya-unit-sitelink:after {
   display: inline-block;
   content: "|";
   margin: 0 5px;
}
 .ya-unit-sitelink:last-child:after {
   display: none;
}
 .category-with-age {
   margin-left: 8px;
   color: #7F7F7F;
   display: flex;
   flex-shrink: 0;
   align-items: center;
   flex: none;
}
 .warning {
   color: #7F7F7F;
   margin-right: 8px;
   max-width: 100%;
   display: flex;
}
 .warning-text {
   flex: 1 1 auto;
   overflow: hidden;
   text-overflow: ellipsis;
   margin-left: 8px;
}
 .badge {
   background: rgba(0, 0, 0, 0.05);
   border-radius: 4px;
   padding: 2px 4px;
   font-size: 8px;
   font-style: normal;
   font-weight: 500;
   line-height: 10px;
   letter-spacing: 0.8px;
   text-transform: uppercase;
}
 .badge-more {
   background: rgba(0, 0, 0, 0.05);
   color: #1A1A1A;
   border-radius: 10px;
   padding: 4px 8px;
   line-height: 16px;
   min-width: 106px;
   box-sizing: border-box;
}
 .age {
   display: none;
   margin-left: 4px;
}
 .unit-with-age .age {
   display: inline;
}
 .ya-unit-kebab_button, .ya-ad-close {
   width: 32px;
   height: 32px;
   right: 5px;
   top: 50%;
   transform: translate(0, -50%);
   padding: 0px;
   background: none;
   color: #000;
   opacity: 0.6;
}
 .ya-ad-close {
   display: flex;
   align-items: center;
   justify-content: center;
}
 .ya-ad-close.yrw-hidden {
   display: none;
}
 .ya-ad-close__cross {
   width: 16px;
   height: 16px;
   background-image: url("data:image/svg+xml;base64,") !important;
}
 .content_is_dark .ya-ad-close__cross {
   background-image: url("data:image/svg+xml;base64,") !important;
}
 .ya-unit-kebab_button:hover {
   opacity: 1;
   background: none;
}
 .content_is_dark .wrap {
   color: #fff;
}
 .content_is_dark .ya-unit-kebab_button, .content_is_dark .ya-ad-close {
   color: #fff;
   opacity: 0.2;
}
 .content_is_dark .ya-unit-kebab_button:hover, .content_is_dark .ya-ad-close:hover {
   opacity: 0.5;
}
 .content_is_dark .badge, .content_is_dark .badge-more {
   background-color: rgba(102, 102, 102, 0.4);
   color: rgba(255, 255, 255, 0.4);
}
 .content_is_dark .category-with-age {
   color: #666;
}
 .ya-adtune-feedback__messages {
   padding: 0 39px 0 12px;
}
 .ya-adtune-feedback__title {
   white-space: nowrap;
   flex-shrink: 0;
   margin-right: 20px;
}
 .ya-adtune-feedback__complain {
   cursor: pointer;
   color: #7F7F7F;
   border: 0.8px solid rgba(0, 0, 0, 0.2);
   border-radius: 6px;
}
 .ya-adtune-feedback__complain:hover {
   color: #000;
   border-color: #000;
}
 .ya-adtune-feedback__complain:last-child {
   border: none;
   background: none !important;
   margin-right: 0;
}
 .ya-adtune-feedback__form {
   border-radius: 8px;
}
 .ya-unit-kebab_button.yrw-hidden+.ya-ad-close {
   display: none;
}
 .ya-unit-kebab_bg {
   background: none;
}
 .content_is_dark .ya-adtune-feedback__form {
   background: #262626;
}
 .content_is_dark .ya-adtune-feedback__complain {
   background: rgba(255, 255, 255, 0.2);
   border: none;
   color: rgba(255, 255, 255, 0.6);
}
 .content_is_dark .ya-adtune-feedback__complain:hover {
   background: rgba(255, 255, 255, 0.3);
   color: #fff;
}
 .content_is_dark .ya-adtune-feedback__title, .content_is_dark .ya-adtune-feedback__abuse-text {
   color: #fff;
}
 .content_is_dark .ya-adtune-feedback__abuse-icon path {
   fill: #fff;
}
 .newspaper-theme .wrap {
   font-family: Georgia, sans-serif;
}
 @media (max-width: 1600px) {
   .ad_desc_hidden .unit-with-warning .desc {
	 display: none;
  }
}
 @media (max-width: 1052px) {
   .image-big {
	 display: none;
  }
   .image-small {
	 display: block;
  }
}
 @media (max-width: 1024px) {
   .favicon {
	 display: none;
  }
}
